--
-- Name: dashboard_summary; Type: VIEW; Schema: public; Owner: admin
--

CREATE VIEW public.dashboard_summary AS
 SELECT t.tasks_id AS task_id,
    t.title,
    t.monday_status,
    t.internal_status,
    t.priority,
    t.created_at,
    tr.status AS last_run_status,
    tr.current_node,
    tr.progress_percentage,
    pr.github_pr_url,
    pr.pr_status
   FROM ((public.tasks t
     LEFT JOIN LATERAL ( SELECT r.tasks_runs_id,
            r.task_id,
            r.run_number,
            r.status,
            r.celery_task_id,
            r.current_node,
            r.progress_percentage,
            r.ai_provider,
            r.model_name,
            r.result,
            r.error_message,
            r.git_branch_name,
            r.pull_request_url,
            r.started_at,
            r.completed_at,
            r.duration_seconds
           FROM public.task_runs r
          WHERE (r.task_id = t.tasks_id)
          ORDER BY r.started_at DESC
         LIMIT 1) tr ON (true))
     LEFT JOIN LATERAL ( SELECT p.pull_requests_id,
            p.task_id,
            p.task_run_id,
            p.github_pr_number,
            p.github_pr_url,
            p.pr_title,
            p.pr_description,
            p.pr_status,
            p.mergeable,
            p.conflicts,
            p.reviews_required,
            p.reviews_approved,
            p.created_at,
            p.merged_at,
            p.closed_at,
            p.head_sha,
            p.base_branch,
            p.feature_branch
           FROM public.pull_requests p
          WHERE (p.task_id = t.tasks_id)
          ORDER BY p.created_at DESC
         LIMIT 1) pr ON (true))
  ORDER BY t.created_at DESC;


