--
-- Name: mv_cost_analysis; Type: MATERIALIZED VIEW; Schema: public; Owner: admin
--

CREATE MATERIALIZED VIEW public.mv_cost_analysis AS
 SELECT date_trunc('day'::text, pm.recorded_at) AS day,
    tr.ai_provider,
    tr.model_name,
    sum(pm.total_ai_cost) AS daily_cost,
    count(*) AS runs_count,
    avg(pm.total_tokens_used) AS avg_tokens
   FROM (public.performance_metrics pm
     JOIN public.task_runs tr ON ((tr.tasks_runs_id = pm.task_run_id)))
  WHERE (pm.recorded_at >= (now() - '30 days'::interval))
  GROUP BY (date_trunc('day'::text, pm.recorded_at)), tr.ai_provider, tr.model_name
  WITH NO DATA;


ALTER TABLE public.mv_cost_analysis OWNER TO admin;

--
-- Name: mv_dashboard_stats; Type: MATERIALIZED VIEW; Schema: public; Owner: admin
--

CREATE MATERIALIZED VIEW public.mv_dashboard_stats AS
 SELECT date_trunc('hour'::text, tasks.created_at) AS hour_bucket,
    tasks.internal_status,
    count(*) AS task_count,
    avg(EXTRACT(epoch FROM (tasks.completed_at - tasks.started_at))) AS avg_duration_seconds
   FROM public.tasks
  WHERE (tasks.created_at >= (now() - '7 days'::interval))
  GROUP BY (date_trunc('hour'::text, tasks.created_at)), tasks.internal_status
  WITH NO DATA;


ALTER TABLE public.mv_dashboard_stats OWNER TO admin;

--
-- Name: mv_realtime_monitoring; Type: MATERIALIZED VIEW; Schema: public; Owner: admin
--

CREATE MATERIALIZED VIEW public.mv_realtime_monitoring AS
 SELECT tasks.internal_status,
    count(*) AS count,
    avg((EXTRACT(epoch FROM (now() - tasks.started_at)) / (60)::numeric)) AS avg_minutes_since_start
   FROM public.tasks
  WHERE ((tasks.internal_status)::text = ANY ((ARRAY['pending'::character varying, 'processing'::character varying, 'testing'::character varying, 'debugging'::character varying])::text[]))
  GROUP BY tasks.internal_status
  WITH NO DATA;


ALTER TABLE public.mv_realtime_monitoring OWNER TO admin;

--
-- Name: performance_dashboard; Type: VIEW; Schema: public; Owner: admin
--

CREATE VIEW public.performance_dashboard AS
 SELECT date_trunc('day'::text, t.created_at) AS date,
    count(t.tasks_id) AS total_tasks,
    count(*) FILTER (WHERE ((tr.status)::text = 'completed'::text)) AS completed_tasks,
    count(*) FILTER (WHERE ((tr.status)::text = 'failed'::text)) AS failed_tasks,
    avg(pm.total_duration_seconds) AS avg_duration,
    avg(pm.total_ai_cost) AS avg_cost,
    avg(pm.test_coverage_final) AS avg_coverage
   FROM ((public.tasks t
     LEFT JOIN LATERAL ( SELECT r.tasks_runs_id,
            r.task_id,
            r.run_number,
            r.status,
            r.celery_task_id,
            r.current_node,
            r.progress_percentage,
            r.ai_provider,
            r.model_name,
            r.result,
            r.error_message,
            r.git_branch_name,
            r.pull_request_url,
            r.started_at,
            r.completed_at,
            r.duration_seconds
           FROM public.task_runs r
          WHERE (r.task_id = t.tasks_id)
          ORDER BY r.started_at DESC
         LIMIT 1) tr ON (true))
     LEFT JOIN public.performance_metrics pm ON ((pm.task_id = t.tasks_id)))
  GROUP BY (date_trunc('day'::text, t.created_at))
  ORDER BY (date_trunc('day'::text, t.created_at)) DESC;


ALTER TABLE public.performance_dashboard OWNER TO admin;

