--
-- Name: v_recent_update_triggers; Type: VIEW; Schema: public; Owner: admin
--

CREATE VIEW public.v_recent_update_triggers AS
 SELECT t.trigger_id,
    t.task_id,
    tasks.title AS task_title,
    tasks.monday_item_id,
    t.monday_update_id,
    t.detected_type,
    t.confidence,
    t.requires_workflow,
    t.triggered_workflow,
    t.new_run_id,
    t.created_at,
    SUBSTRING(t.update_text FROM 1 FOR 100) AS update_preview,
    (t.extracted_requirements ->> 'title'::text) AS request_title,
    (t.extracted_requirements ->> 'priority'::text) AS request_priority
   FROM (public.task_update_triggers t
     LEFT JOIN public.tasks ON ((t.task_id = tasks.tasks_id)))
  ORDER BY t.created_at DESC
 LIMIT 50;


ALTER TABLE public.v_recent_update_triggers OWNER TO admin;

