-- Name: VIEW v_recent_update_triggers; Type: COMMENT; Schema: public; Owner: admin
--

COMMENT ON VIEW public.v_recent_update_triggers IS 'Vue des 50 déclenchements les plus récents avec informations essentielles';


--
-- Name: v_update_trigger_stats; Type: VIEW; Schema: public; Owner: admin
--

CREATE VIEW public.v_update_trigger_stats AS
 SELECT task_update_triggers.detected_type,
    count(*) AS total_count,
    sum(
        CASE
            WHEN task_update_triggers.requires_workflow THEN 1
            ELSE 0
        END) AS requires_workflow_count,
    sum(
        CASE
            WHEN task_update_triggers.triggered_workflow THEN 1
            ELSE 0
        END) AS triggered_workflow_count,
    avg(task_update_triggers.confidence) AS avg_confidence,
    min(task_update_triggers.created_at) AS first_seen,
    max(task_update_triggers.created_at) AS last_seen
   FROM public.task_update_triggers
  GROUP BY task_update_triggers.detected_type
  ORDER BY (count(*)) DESC;


ALTER TABLE public.v_update_trigger_stats OWNER TO admin;

