 statement.executeQuery(selectSQLValue(column, table, condition));\\n        String result = null;\\n        if(resultSet.next()) result = resultSet.getString(1);\\n        statement.close();\\n        return result;\\n    }\\n\\n    public String selectValue(Connection connection, String column, String table) throws SQLException {\\n        return selectValue(connection, column, table, \\"1=1\\");\\n    }\\n\\n    public List<Object> selectListObject(Connection connection, Class<?> object, String condition, int limit) throws SQLException, NoSuchMethodException, InvocationTargetException, InstantiationException, IllegalAccessException {\\n        Statement statement = connection.createStatement();\\n        ResultSet resultSet = statement.executeQuery(selectSQLObject(object.getSimpleName(), condition));\\n\\n        List<Object> results = new ArrayList<>();\\n        Field[] fields = DBTool.getFieldWithSuperclass(object.getConstructor().newInstance());\\n        int limitCount = 0;\\n\\n        while(resultSet.next() && limitCount!=limit) {\\n            Object newObject = object.getConstructor().newInstance();\\n            for (Field field : fields) {\\n                Method objectSetter;\\n                try {\\n                    objectSetter = object.getSuperclass().getDeclaredMethod(\\"set\\" + DBTool.upperFirst(field.getName()), field.getType());\\n                } catch (NoSuchMethodException ignored) {\\n                    objectSetter = object.getDeclaredMethod(\\"set\\" + DBTool.upperFirst(field.getName()), field.getType());\\n                }\\n                Method resultGetType;\\n                if (field.getType() == LocalDateTime.class) {\\n                    String dateTime = resultSet.getTimestamp(field.getName()).toString().split(\\"\\\\\\\\.\\")[0];\\n                    DateTimeFormatter formatter = DateTimeFormatter.ofPattern(\\"yyyy-MM-dd HH:mm:ss\\");\\n                    objectSetter.invoke(newObject, LocalDateTime.parse(dateTime, formatter)\\n                    );\\n                } else if (field.getType() == LocalDate.class) {\\n                    DateTimeFormatter formatter = DateTimeFormatter.ofPattern(\\"yyyy-MM-dd\\");\\n                    resultGetType = ResultSet.class.getDeclaredMethod(\\"getDate\\", String.class);\\n                    objectSetter.invoke(newObject, LocalDate.parse(resultGetType.invoke(resultSet, field.getName()).toString(), formatter));\\n                } else if (field.getType() == LocalTime.class) {\\n                    DateTimeFormatter formatter = DateTimeFormatter.ofPattern(\\"HH:mm:ss\\");\\n                    resultGetType = ResultSet.class.getDeclaredMethod(\\"getTime\\", String.class);\\n                    objectSetter.invoke(newObject, LocalTime.parse(resultGetType.invoke(resultSet, field.getName()).toString(), formatter));\\n                } else if (field.getType() == byte[].class) {\\n                    resultGetType = ResultSet.class.getDeclaredMethod(\\"getBytes\\", String.class);\\n                    objectSetter.invoke(newObject, resultGetType.invoke(resultSet, field.getName()));\\n                } else {\\n                    resultGetType = ResultSet.class.getDeclaredMethod(\\"get\\" + DBTool.upperFirst(field.getType().getSimpleName()), String.class);\\n                    objectSetter.invoke(newObject, resultGetType.invoke(resultSet, field.getName()));\\n                }\\n            }\\n            results.add(newObject);\\n            limitCount++;\\n        }\\n\\n        statement.close();\\n        return results;\\n    }\\n\\n    public List<Object> selectListObject(Connection connection, Class<?> object, String condition) throws SQLException, NoSuchMethodException, InvocationTargetException, InstantiationException, IllegalAccessException {\\n        return selectListObject(connection, object, condition, -1);\\n    }\\n\\n    public Object selectObject(Connection connection,  Class<?> object, String condition) throws SQLException, InvocationTargetException, NoSuchMethodException, InstantiationException, IllegalAccessException {\\n        List<Object> objectList = selectListObject(connection, object, condition, 1);\\n        if(objectList.isEmpty()) return null;\\n        return objectList.get(0);\\n    }\\n\\n    public String getSequence(Connection connection, Sequence sequence) throws SQLException {\\n        Statement statement = connection.createStatement();\\n        ResultSet resultSet = statement.executeQuery(getSequenceSQL(sequence));\\n        String result = null;\\n        if(resultSet.next()) result = resultSet.getString(1);\\n        statement.close();\\n        return result;\\n    }\\n\\n\\n    /** Setters and getters */\\n    public String getHost() {\\n        return host;\\n    }\\n\\n    public void setHost(String host) {\\n        this.host = host;\\n    }\\n\\n    public String getPort() {\\n        return port;\\n    }\\n\\n    public void setPort(String port) {\\n        this.port = port;\\n    }\\n\\n    public String getDbName() {\\n        return dbName;\\n    }\\n\\n    public void setDbName(String dbName) {\\n        this.dbName = dbName;\\n    }\\n\\n    public String getUser() {\\n        return user;\\n    }\\n\\n    public void setUser(String user) {\\n        this.user = user;\\n    }\\n\\n    public String getPassword() {\\n        return password;\\n    }\\n\\n    public void setPassword(String password) {\\n        this.password = password;\\n    }\\n}\\n", "/var/folders/bv/3lkzxqps10b1h3wh0mb1tg0w0000gn/T/ai_agent_5siafw5y/src/database/core/Sequence.java": "package database.core;\\n\\npublic class Sequence {\\n    String prefix;\\n    int length;\\n    String sequenceName;\\n\\n    /**\\n     * ORACLE\\n     * CREATE SEQUENCE moneySequence START WITH 1 INCREMENT BY 1;\\n\\n     CREATE OR REPLACE FUNCTION moneySequenceTest(length in number, prefix in varchar2)\\n     return varchar\\n     is result varchar(255);\\n     BEGIN\\n     return  prefix || lpad(moneySequence.nextval, length, '0');\\n     end;\\n\\n     select moneySequenceTest(6, 'STR') from DUAL;\\n     */\\n    public Sequence(String prefix, int length, String sequenceName) {\\n        setPrefix(prefix);\\n        setLength(length);\\n        setSequenceName(sequenceName);\\n    }\\n\\n    public String getPrefix() {\\n        return prefix;\\n    }\\n\\n    public void setPrefix(String prefix) {\\n        this.prefix = prefix;\\n    }\\n\\n    public int getLength() {\\n        return length;\\n    }\\n\\n    public void setLength(int length) {\\n        this.length = length;\\n    }\\n\\n    public String getSequenceName() {\\n        return sequenceName;\\n    }\\n\\n    public void setSequenceName(String sequenceName) {\\n        this.sequenceName = sequenceName+\\"_seq\\";\\n    }\\n}\\n", "/var/folders/bv/3lkzxqps10b1h3wh0mb1tg0w0000gn/T/ai_agent_5siafw5y/src/database/core/GenericDAO.java": "package database.core;\\n\\nimport database.exception.SQL.AttributeMissingException;\\nimport database.exception.SQL.AttributeTypeNotExistingException;\\nimport database.exception.object.NotIdentifiedInDatabaseException;\\n\\nimport java.lang.reflect.InvocationTargetException;\\nimport java.sql.SQLException;\\nimport java.sql.Timestamp;\\nimport java.time.Instant;\\nimport java.util.List;\\n\\npublic class GenericDAO {\\n    String id;\\n\\n    public void createTable(DBConnection dbConnection) throws SQLException, AttributeTypeNotExistingException, AttributeMissingException {\\n        dbConnection.getDatabase().createTable(dbConnection.getConnection(), this);\\n        dbConnection.getDatabase().createSequence(dbConnection.getConnection(), getClass().getSimpleName()+\\"_seq\\");\\n    }\\n\\n    public void save(DBConnection dbConnection, Sequence sequence) throws SQLException, InvocationTargetException, NoSuchMethodException, IllegalAccessException {\\n        setId(dbConnection.getDatabase().getSequence(dbConnection.getConnection(), sequence));\\n        dbConnection.getDatabase().insertObject(dbConnection.getConnection(), this);\\n    }\\n\\n    public void save(DBConnection dbConnection) throws SQLException, InvocationTargetException, NoSuchMethodException, IllegalAccessException {\\n        Sequence sequence = new Sequence(\\"\\", 10, getClass().getSimpleName());\\n        save(dbConnection, sequence);\\n    }\\n\\n    void update(DBConnection dbConnection, String condition) throws SQLException, InvocationTargetException, NoSuchMethodException, IllegalAccessException {\\n        dbConnection.getDatabase().updateObject(dbConnection.getConnection(), condition, this);\\n    }\\n\\n    public void update(DBConnection dbConnection) throws SQLException, InvocationTargetException, NoSuchMethodException, IllegalAccessException, NotIdentifiedInDatabaseException {\\n        update(dbConnection,\\"id='\\"+getId()+\\"'\\");\\n    }\\n\\n    void delete(DBConnection dbConnection, String condition) throws SQLException {\\n        dbConnection.getDatabase().delete(dbConnection.getConnection(), getClass().getSimpleName(), condition);\\n    }\\n\\n    public void delete(DBConnection dbConnection) throws SQLException, NotIdentifiedInDatabaseException {\\n        delete(dbConnection, \\"id='\\"+getId()+\\"'\\");\\n    }\\n\\n    public List<Object> getAll(DBConnection dbConnection, String condition) throws SQLException, InvocationTargetException, NoSuchMethodException, InstantiationException, IllegalAccessException {\\n        return dbConnection.getDatabase().selectListObject(dbConnection.getConnection(), getClass(), condition);\\n    }\\n\\n    public List<Object> getAll(DBConnection dbConnection) throws SQLException, InvocationTargetException, NoSuchMethodException, InstantiationException, IllegalAccessException {\\n        return getAll(dbConnection, \\"1=1\\");\\n    }\\n\\n    public Object get(DBConnection dbConnection, String condition) throws SQLException, InvocationTargetException, NoSuchMethodException, InstantiationException, IllegalAccessException {\\n        return dbConnection.getDatabase().selectObject(dbConnection.getConnection(), getClass(), condition);\\n    }\\n\\n    public Object getById(DBConnection dbConnection, String id) throws SQLException, InvocationTargetException, NoSuchMethodException, InstantiationException, IllegalAccessException {\\n        return get(dbConnection, \\"id='\\"+id+\\"'\\");\\n    }\\n\\n    public void historize(DBConnection dbConnection, String action) throws SQLException, InvocationTargetException, NoSuchMethodException, IllegalAccessException {\\n        dbConnection.getDatabase().insert(dbConnection.getConnection(), \\"history\\", Timestamp.from(Instant.now()), getClass().getSimpleName(), action, toString());\\n    }\\n\\n    public void setId(String id) {\\n        this.id = id;\\n    }\\n\\n    public String getId() throws NotIdentifiedInDatabaseException {\\n        if(id == null) throw new NotIdentifiedInDatabaseException(this);\\n        return id;\\n    }\\n}\\n", "/var/folders/bv/3lkzxqps10b1h3wh0mb1tg0w0000gn/T/ai_agent_5siafw5y/src/database/provider/Oracle.java": "package database.provider;\\n\\nimport database.core.*;\\nimport database.exception.SQL.AttributeTypeNotExistingException;\\n\\nimport java.lang.reflect.Field;\\nimport java.sql.*;\\n\\n/** Class that implements Oracle SQL in Java */\\npublic class Oracle extends Database {\\n    \\n    /** Constructor */\\n    public Oracle(String host, String port, String dbName, String user, String password) {\\n        super(host, port, dbName, user, password);\\n    }\\n\\n    \\n    /** Create a connection and return a DBConnection that contain the database and an instance of connection */\\n    @Override\\n    public DBConnection createConnection() throws SQLException {\\n        try {\\n            Class.forName(\\"com.oracle.jdbc.Driver\\");\\n        } catch (Exception ignored) {} // Ignore problem with the javac classpath TODO Find solution\\n        String url = \\"jdbc:ora